  03> JEFFERD, Peter William
  b 26.03.1956
  Peter b. at Gisborne. Address: PO Box 3007, Gisborne.
  Peter was educated at Huntley School, Marton and Wanganui Collegiate School and graduated BComm
  from Canterbury University in 1978. He is a banker and is presently in London and travelling.
  04> JEFFERD, Mark
  b 07.06.1967 d 07.06.1967
  Mark cremated at Hastings.
  04> DAVIES, Christopher Pearson m on 08.10.1883 to WILLIAMS, Mary Anne
  b 11.11.1849 d ** **.1924
  b 11.01.1850 d 14.08.1924
  Christopher b. at Tauranga and d. at Gisborne. Mary, d/o Edward Marsh Williams and Jane Davis,
  b. at Waimate and d. at Gisborne. Christopher was assistant manager of Williams and Kettle in
  Gisborne. He was also a keen rower and member of several winning crews.
  01> DAVIES, Eileen Pearson
  b 10.08.1884 d 01.05.1980
  Eileen b. and d. at Gisborne. She was a dedicated and active member of the Anglican Church in Gisborne.
  02> DAVIES, Freda Lilian m on 30.10.1912 to DODGSHUN, Gordon Mawley
  b 21.11.1885 d 04.11.1966
  b 13.11.1884 d 14.02.1970
  Freda and Gordon both b. at Gisborne, Gordon, slo Joseph Sydney Dodgshun, is a descendant of Thomas Sydney
  Williams, brother of Henry and William, through his daughter, Betsy Field who married Charles Dodgshun.
  Gordon's father was accountant for the Williams Estate at Waipiro Bay.
  Freda was an accomplished pianist, accompanist and composer of music. She often accompanied prominent
  artists visiting Gisborne. She was also an ardent student of her family history and a keen gardener.
  Gordon was a dentist in Gisborne. He was educated at Wanganui Collegiate School and spent all his early
  years at Waipiro Bay, north of Gisborne. He was a very good golfer (runner-up at the New Zealand amateur
  golf championships in 1912, winner of the Hawkes Bay amateur golf championship in 1926 and eight times
  winner of the Poverty Bay golf club championship). He was also a prominent rower and a champion swimmer and
  high diver. He served in the NZ Dental Corps in ww1 in New Zealand and in England.
  01> DODGSHUN, Joseph Terence (Joe) m on 25.11.1949 to DODS, June Shirley
  b 26.04.1915
  b 25.05.1925
  Joseph b. and m. at Gisborne. June, d/o Geoffrey Francis Dods and Florence Maude Benson, b, at
  Gisborne. Address: Ditton, 11 Kingsley Street, Gisborne.
  Joseph was educated at Wanganui Collegiate School, Gisborne Boys' High School (1st rugby XV 1933) and
  Otago University (Golf Blue, BDS, 1938). He was on the staff of the Otago University Dental School
  until May 1939 then commenced practice with his father in Gisborne. He served as a captain in the NZ
  Dental Corps from 1939 to 1945, going overseas with the 3rd Echelon. He was taken prisoner in Athens
  in 1941 and was transferred to Obermassfeld in Germany where he was held until 1945. He was awarded
  the MBE for service in POW hospitals. Joe resumed dental practice in Gisborne after the war and
  retired in 1984. He won the Poverty Bay open golf championship in 1949.
  June was educated at Gisborne Girls' High School then joined the staff of the Bank of New Zealand in
  Gisborne. In the latter years of the war she was elected Navy Queen in fund raising for the war
  effort. A keen golfer, she won the Poverty Bay Ladies' Senior Golf Club Championship on two occasions
  and represented Hawkes Bay/ Poverty Bay in interprovincial golf. She is also a keen gardener.
  Joe and June both enjoy playing bridge.
